          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](34, "Si tiene un restaurante, los datos del nombre del restaurante, el horario, la ubicaci\xF3n y todo su men\xFA, ser\xE1n mostrados a los usuarios para que puedan decidirse a hacer un pedido y/o conocer m\xE1s sobre su negocio. El tel\xE9fono de contacto de su negocio, s\xF3lo se le mostrar\xE1 en algunas ocasiones a los usuarios al momento de hacer un pedido, por cualquier situaci\xF3n en que el cliente necesite comunicarse con usted despu\xE9s de haber realizado su pedido. Nosotros conservamos su informaci\xF3n \xFAnicamente durante el tiempo que usted mantenga una cuenta creada en nuestra plataforma; en caso de que usted decida eliminar su cuenta de Ralph por cualquier motivo, eliminaremos sus datos de nuestra base de datos.");

