          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](41, "p", 11);

          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](42, "Ralph est\xE1 altamente comprometido en cumplir con el compromiso de mantener su informaci\xF3n segura. Usamos sistemas y t\xE9cnicas avanzadas y las actualizaremos constantemente, para asegurarnos que no exista ning\xFAn acceso no autorizado. Todos los env\xEDos de informaci\xF3n a trav\xE9s de la aplicaci\xF3n web es encriptada mediante la tecnolog\xEDa Secure Socket Layer (SSL).");

