          _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](44, "Para proteger su informaci\xF3n personal, tomamos precauciones razonables y seguimos las mejores pr\xE1cticas de la industria para asegurarnos de que no haya p\xE9rdida de manera inapropiada, mal uso, acceso, divulgaci\xF3n, alteraci\xF3n o destrucci\xF3n de la misma. As\xED mismo, debe tener en cuenta que no nos hacemos responsables de cualquier tipo de intersecci\xF3n de una petici\xF3n que se realice al servidor o alg\xFAn robo o mal uso de uno de sus datos personales, aunque se le recompensar\xE1 al usuario afectado con alg\xFAn cup\xF3n o promoci\xF3n especial y tomaremos acci\xF3n inmediata para arreglar el problema, aumentar nuestra seguridad y prevenir futuros robos de informaci\xF3n por medio de nuestra aplicaci\xF3n web.");

