        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](92, "Cuando navegas en nuestra aplicaci\xF3n web, tambi\xE9n recibimos de manera autom\xE1tica la direcci\xF3n de protocolo de internet de tu dispositivo (IP).");

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

