        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](95, "strong");

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](96, "Uso de la informaci\xF3n recogida");

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](97, "p", 61);

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](98, "Nuestra aplicaci\xF3n web emplea la informaci\xF3n recogida con el fin de proporcionar el mejor servicio posible, particularmente para mantener un registro de usuarios, de pedidos en caso que aplique, y mejorar nuestro servicio. Al momento de hacer un pedido, se le muestra al restaurante su nombre y apellido, su n\xFAmero de tel\xE9fono y la direcci\xF3n de entrega que usted haya escrito para ese pedido en espec\xEDfico. El tel\xE9fono es necesario por si el restaurante necesita comunicarse con usted por alguna situaci\xF3n extraordinaria (como el hecho de que ya no tenga del producto que acaba de hacer el pedido, que la direcci\xF3n de entrega proporcionada no exista, o cualquier otra situci\xF3n que el restaurante necesite comunicarle). La informaci\xF3n sobre el municipio al que pertenece, es para mostrarle los restaurantes y sus productos que est\xE1n disponibles en el municipio al cual usted pertenece, y regular el que usted intente hacer pedidos a restaurantes de otros municipios. Su correo electr\xF3nico y contrase\xF1a fueron necesarios para que usted pudiera iniciar sesi\xF3n en los dispositivos que usted dese\xE9 y no permitir que otra persona que no sabe su correo electr\xF3nico y su contrase\xF1a, pueda hacer pedidos utilizando sus datos.");

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](99, "p", 61);

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](100, "Si tiene un restaurante, los datos del nombre del restaurante, el horario, la ubicaci\xF3n y todo su men\xFA, ser\xE1n mostrados a los usuarios para que puedan decidirse a hacer un pedido y/o conocer m\xE1s sobre su negocio. El tel\xE9fono de contacto de su negocio, s\xF3lo se le mostrar\xE1 en algunas ocasiones a los usuarios al momento de hacer un pedido, por cualquier situaci\xF3n en que el cliente necesite comunicarse con usted despu\xE9s de haber realizado su pedido. Nosotros conservamos su informaci\xF3n \xFAnicamente durante el tiempo que usted mantenga una cuenta creada en nuestra plataforma; en caso de que usted decida eliminar su cuenta de Ralph por cualquier motivo, eliminaremos sus datos de nuestra base de datos.");

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](101, "p", 61);

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](102, "Es posible que sean enviadas notificaciones peri\xF3dicamente (por medio de notificaciones push, mensajes sms o correo electr\xF3nico) con ofertas especiales, nuevos productos y otra informaci\xF3n publicitaria que consideremos relevante para usted o que pueda brindarle alg\xFAn beneficio; estas notificaciones ser\xE1n enviados a el correo electr\xF3nico o tel\xE9fono que usted proporcion\xF3 y podr\xE1n ser cancelados en cualquier momento.");

