        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](115, "p", 61);

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](116, "Una cookie se refiere a un fichero que es enviado con la finalidad de solicitar permiso para almacenarse en su ordenador, al aceptar dicho fichero se crea y la cookie sirve entonces para tener informaci\xF3n respecto al tr\xE1fico web, y tambi\xE9n facilita las futuras visitas a una web recurrente. Otra funci\xF3n que tienen las cookies es que con ellas las web pueden reconocerte individualmente y por tanto brindarte el mejor servicio personalizado de su web.");

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](117, "p", 61);

        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](118, "Nuestra aplicaci\xF3n web emplea las cookies para poder identificar las p\xE1ginas que son visitadas y su frecuencia. Esta informaci\xF3n es empleada \xFAnicamente para an\xE1lisis estad\xEDstico y despu\xE9s la informaci\xF3n se elimina de forma permanente. Usted puede eliminar las cookies en cualquier momento desde su ordenador. Sin embargo las cookies ayudan a proporcionar un mejor servicio de los sitios web, \xE9stas no dan acceso a informaci\xF3n de su ordenador ni de usted, a menos de que usted as\xED lo quiera y la proporcione directamente. Usted puede aceptar o negar el uso de cookies, sin embargo la mayor\xEDa de navegadores aceptan cookies autom\xE1ticamente, pues sirve para tener un mejor servicio web. Tambi\xE9n usted puede cambiar la configuraci\xF3n de su ordenador para declinar las cookies. Si se declinan es posible que no pueda utilizar algunos de nuestros servicios.");

