        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](126, "Esta aplicaci\xF3n web pudiera contener enlaces a otros sitios que pudieran ser de su inter\xE9s. Una vez que usted de clic en estos enlaces y abandone nuestra p\xE1gina, ya no tenemos control sobre el sitio al que es redirigido y, por lo tanto, no somos responsables de los t\xE9rminos o privacidad ni de la protecci\xF3n de sus datos en esos otros sitios terceros. Dichos sitios est\xE1n sujetos a sus propias pol\xEDticas de privacidad por lo cual es recomendable que los consulte para confirmar que usted est\xE1 de acuerdo con estas.");

