        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](138, "En cualquier momento usted puede restringir la recopilaci\xF3n o el uso de la informaci\xF3n personal que es proporcionada a nuestra aplicaci\xF3n web. Cada vez que se le solicite rellenar un formulario, como el de crear una cuenta usuario, usted es el que decide llenar esos datos para poder hacer uso de nuestros servicios. En cualquier momento puede solicitar un cambio de informaci\xF3n en sus datos personales (como un cambio de su tel\xE9fono, cambio de su nombre y apellido, etc), puede solicitar que se elimine su cuenta o solicitar que se le dejen de enviar cualquier tipo de notificaciones. Para solicitar cualquiera de estas cosas, simplemente debes enviarnos un correo con tu petici\xF3n a ralphaplication@gmail.com; nosotros r\xE1pidamente leeremos tu mensaje y tomaremos acci\xF3n en el asunto, aunque no har\xE9mos ning\xFAn cambio en tu cuenta sin antes comprobar que en verdad eres t\xFA quien est\xE1 haciendo la petici\xF3n.");

